import React from "react";
const ImageLinkForm = () => {
  return (
    <div>
      <p className="f3">
        {"This app lets you choose an image and it detects faces"}
      </p>
      <div>
        <input type="text" />
      </div>
    </div>
  );
};
export default ImageLinkForm;
